import { Link } from 'react-router-dom';

import { Button } from '../../components/Button';
import { Header } from '../../components/Header';

const Home = () => {
    return (<>
        <h1>Home</h1>
        <Button title="Teste 1" />
        <Button variant='secondary' title="Teste2" />
        <Link to="/login">Login</Link>
    </>)
}

export { Home }
